Der opstod en fejl ved opsætningen af interproces-
kommunikationen i KDE. Beskeden fra systemet
var:

Προειδοποίηση:  Αυτή είναι μια ασφαλής φόρμα αλλά προσπαθεί να στείλει πίσω τα δεδομένα σας ακρυπτογράφητα.
Τρίτοι μπορούν να παρεμβληθούν και να δουν αυτές τις πληροφορίες.
Σίγουρα θέλετε να συνεχίσετε;

setează stilul de introducere XIM (X Input Method);
valorile posibile sînt "onthespot", "overthespot",
"offthespot" şi "root".
